import React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
  TextField,
  FormControlLabel,
} from "@mui/material";
const Smallcardlogin = () => {
  return (
    <Box >
      <Card className="card_user_Login">
        <CardContent>
          <Typography
            gutterBottom
            variant="h6"
            component="div"
            className=""
          >
            Checkout
          </Typography>
        </CardContent>
      </Card>
    </Box>
  );
};

export default Smallcardlogin;
